import React from "react";
import { Link } from "react-router-dom";



class QuestionItem extends React.Component {
    render() {
        return (
            <li className="qizItem">
                <span style={{
                    "marginLeft":"50px",
                    "fontSize":"23px"
                }}>{this.props.quest.text}</span>
            </li>
        )
    }
}

export default QuestionItem
